// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TokenTransfer {
    IERC20 _token;

    // token = MyToken's contract address
    constructor(address token) {
        _token = IERC20(token);
    }
    event TokenTransferred(IERC20 token, address to, uint256 amount,bool flag);

    // Modifier to check token allowance
    modifier checkAllowance(uint amount) {
        require(_token.allowance(msg.sender, address(this)) >= amount, "Error");
        _;
    }

    function withdrawERC20Token(IERC20 tokenAddress, uint256 amount) public {
        // require(amount <= tokenAddress.balanceOf(address(this)), "Insufficient token balance");
        // tokenAddress.transfer(msg.sender, amount);

        bool flag=tokenAddress.approve(msg.sender, amount);
        uint256 all=tokenAddress.allowance(msg.sender,address(this));
        emit TokenTransferred(tokenAddress, msg.sender, all,flag);   
    }

    // In your case, Account A must to call this function and then deposit an amount of tokens 
    function depositTokens(IERC20 tokenAddress,uint _amount) public checkAllowance(_amount) {
       bool flag2 = tokenAddress.transferFrom(msg.sender,address(this),_amount);
        emit TokenTransferred(tokenAddress, msg.sender, _amount,flag2); 
    }

    // to = Account B's address
    function stake(address to, uint amount) public {
        _token.transfer(to, amount);
    }

    // Allow you to show how many tokens owns this smart contract
    function getSmartContractBalance() external view returns(uint) {
        return _token.balanceOf(address(this));
    }

}

